tooltip.Size = UDim2.new(0, 1, 0, 1)
tooltip.Position = UDim2.new(0, Owner.AbsolutePosition.X - OwnerFrame.AbsolutePosition.X + Owner.AbsoluteSize.X/2, YOffSet, 0)
