	local TempKitListText = ReadFile("Kits")
	for i = 1, string.len(TempKitListText) do
		if string.sub(TempKitListText, i, i+string.len(KN)) == KN..":" then
			local End = 0
			repeat
				End = End+1
			until string.sub(TempKitListText, i+End, i+End) == "}"
